// Read the file
const filePath = path.join(__dirname, 'src', 'pages', 'CompanionProfile.jsx');
let content = fs.readFileSync(filePath, 'utf8');

// Update images for each profile
Object.keys(imageMap).forEach(id => {
  const { main, gallery } = imageMap[id];
  
  // Create regex to match the profile's image field
  const imageRegex = new RegExp(`(id:\\s*${id},\\s*\\n.*?\\n.*?\\n\\s*image:\\s*)'[^']+'`, 'g');
  content = content.replace(imageRegex, `$1'${main}'`);
  
  // Create regex to match the profile's gallery field
  const galleryRegex = new RegExp(`(id:\\s*${id},[\\s\\S]*?gallery:\\s*\\[)([\\s\\S]*?)(\\],)`, 'g');
  content = content.replace(galleryRegex, 
    `$1\n        '${gallery[0]}',\n        '${gallery[1]}',\n        '${gallery[2]}',\n      $3`
  );
});

// Write back to file
fs.writeFileSync(filePath, content, 'utf8');
console.log(' Successfully updated all 157 companion profiles with unique Unsplash images!');
